			["displayText"] = "%c",
			["customText"] = "function()\n    if UnitHealth(\"target\") ~= 0 then\n        local maxHealth = UnitHealthMax(\"target\")\n        local curHealth = UnitHealth(\"target\")\n        local percent = (curHealth/maxHealth)*100\n        local modulo = percent%15\n        \n        local green = \"|cFF00FF00\"\n        local red = \"|cFFFF0000\"\n        \n        if percent >= 10 then\n            \n            if modulo <= 10  then\n                aura_env.audioPlayed = false\n                return (green .. \"%.1f%%\" .. \"|r\"):format(modulo + 5) or 0\n            else \n                if modulo > 10 \n                and modulo <= 13 \n                and not aura_env.audioPlayed then\n                    PlaySoundFile(\"interface/addOns/weakauras/media/sounds/airhorn.ogg\", \"Master\")\n                    aura_env.audioPlayed = true\n                end\n                \n                return (red .. \"%.1f%%\" .. \"|r\"):format(modulo - 10) or 0\n            end\n        end        \n    end\n    return nil\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
